/* jshint ignore:start */
define(["jquery","core/log"],function(a,b){return b.debug("NED Format Editing Section AMD"),{init:function(){a(document).ready(function(a){
// Individual toggles.
a("ul.nededitingsection li.section .left .nededitingsectionpix").click(function(b){var c=a(this).parent(".left").parent(".section");c.find(".content .section").toggle(),c.find(".content .addresourcemodchooser").toggle(),c.hasClass("closed")?c.removeClass("closed").addClass("open"):c.removeClass("open").addClass("closed")}),
// All toggles compress.
a("#nededitingsectioncompressed").click(function(){a("ul.nededitingsection li.section").each(function(){a(this).find(".content .section").hide(),a(this).find(".content .addresourcemodchooser").hide(),a(this).hasClass("open")&&a(this).removeClass("open").addClass("closed")})}),
// All toggles expand.
a("#nededitingsectionexpanded").click(function(){a("ul.nededitingsection li.section").each(function(){a(this).find(".content .section").show(),a(this).find(".content .addresourcemodchooser").show(),a(this).hasClass("closed")&&a(this).removeClass("closed").addClass("open")})})}),b.debug("NED Format Editing Section AMD init.")}}});